using Bogus;
using Tor.Application.Images.Commands.Upload;
using Tor.Domain.BusinessAggregate.Enums;
using Tor.Domain.Common.Enums;
using Tor.Domain.Common.ValueObjects;

namespace Tor.TestsInfra.CustomFakers;

public partial class Fakers
{
    public static class Images
    {
        private const string ImageContentAsBase64 = "";

        // Domain
        public static readonly Faker<Image> ImageFaker = new Faker<Image>()
            .RuleFor(x => x.Name, f => f.Person.FullName)
            .RuleFor(x => x.Url, f => new Uri(f.Internet.Url()));

        // Commands
        public static readonly Faker<UploadImageCommand> UploadImageCommandFaker = new RecordFaker<UploadImageCommand>()
            .RuleFor(x => x.ContentAsBase64, _ => ImageContentAsBase64)
            .RuleFor(x => x.ImageType, f => f.PickRandom<ImageType>())
            .RuleFor(x => x.EntityType, f => f.PickRandom<EntityType>());
    }
}
